  <br><br>
  <button onclick="checkColors()" style="font-size: 1.5em; padding: 10px 20px;">✅ Vérifier</button>

<script>
  const expectedColors = {
    dormant1: "ff0000", dormant2: "ff0000", dormant3: "ff0000", dormant4: "ff0000",
    parclose1: "1fff00", parclose2: "1fff00",
    rpt1: "666666", rpt2: "666666", rpt3: "666666", rpt4: "666666",
    ji1: "ff00fb", ji2: "ff00fb",
    je1: "ffff00", je2: "ffff00",
    vitrage1: "000000", vitrage2: "000000",
  };

  const palette = Array.from(new Set(Object.values(expectedColors)));
  let paletteIndex = {};

  for (const id in expectedColors) {
    const el = document.getElementById(id);
    if (!el) continue;
    paletteIndex[id] = 0;

    el.style.fill = "transparent";

    el.addEventListener("click", () => {
      paletteIndex[id] = (paletteIndex[id] + 1) % palette.length;
      const color = "#" + palette[paletteIndex[id]];
      el.style.fill = color;
    });
  }

  function getEffectiveFill(el) {
    let fill = window.getComputedStyle(el).fill;

    if (fill.startsWith("rgb")) {
      const rgb = fill.match(/\d+/g).map(Number);
      return rgb.slice(0, 3).map(c => c.toString(16).padStart(2, '0')).join('');
    }

    return fill.replace("#", "").toLowerCase();
  }

  function checkColors() {
    for (const id in expectedColors) {
      const el = document.getElementById(id);
      if (!el) return alert(`Élément ${id} manquant dans le SVG.`);

      const fill = getEffectiveFill(el);
      console.log(`Vérification de ${id}: attendu = ${expectedColors[id]}, trouvé = ${fill}`);

      if (fill !== expectedColors[id]) {
        return alert("❌ Tu as au moins 1 erreur!");
      }
    }
    alert("🎉 Bravo, toutes les couleurs sont correctes !");
  }
</script>
